import org.apache.commons.io.IOUtils
import org.apache.nifi.processor.io.InputStreamCallback

import groovy.json.JsonSlurper

import java.util.stream.Collectors

def flowFile = session.get()
def notification
def jsonSlurper = new JsonSlurper()

session.read(flowFile, { inputStream ->
    notification = jsonSlurper.parseText(IOUtils.toString(inputStream, "UTF-8"))
} as InputStreamCallback)

def dbSchema = flowFile.getAttribute('Export-DbSchema')
def tableNameSuffix = flowFile.getAttribute('Export-TableNameSuffix')

def entityId = notification.data[0].id
def entityTypes
if (notification.data[0].type instanceof List) {
    entityTypes = notification.data[0].type
            .stream().map(type -> ((String) type).toLowerCase())
            .sorted()
            .collect(Collectors.joining("_"))
} else {
    entityTypes = notification.data[0].type.toLowerCase()
}

def sqlDeleteQuery
if (tableNameSuffix != null && tableNameSuffix != '') 
    sqlDeleteQuery = "delete from ${dbSchema}.${entityTypes}_${tableNameSuffix} where entityid = '${entityId}'"
else
    sqlDeleteQuery = "delete from ${dbSchema}.${entityTypes} where entityid = '${entityId}'"

flowFile = session.putAttribute(flowFile, 'sqlDeleteQuery', sqlDeleteQuery)

session.transfer(flowFile, REL_SUCCESS)

import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets
import groovy.json.JsonSlurper
import org.apache.nifi.serialization.record.Record

def flowFile = session.get()
def entities = []
def jsonSlurper = new JsonSlurper()

session.read(flowFile, { inputStream ->
    entities = jsonSlurper.parseText(IOUtils.toString(inputStream, StandardCharsets.UTF_8))
} as InputStreamCallback)

def entitiesWithoutTemporalAttributes = []

entities.each { entity ->
    def entityWithoutTemporalAttributes =
        (entity as Map<String, Object>).findAll {
            it.key in ["id", "type", "scope"] ||
                (it.value instanceof Map && !(it.value as Map).containsKey("observedAt")) ||
                (it.value instanceof List) && !((it.value[0] as Map).containsKey("observedAt"))
        }
    entitiesWithoutTemporalAttributes.add(entityWithoutTemporalAttributes)
}

flowFile = session.write(flowFile, { outputStream ->
    outputStream.write(groovy.json.JsonOutput.toJson(entitiesWithoutTemporalAttributes).getBytes(StandardCharsets.UTF_8))
} as OutputStreamCallback)

session.transfer(flowFile, REL_SUCCESS)
